import React from "react";
function Hero() {
  return (
    <div className="container">
      <div className="row  mt-5 mb-5 p-5">
        <h1 className="fs-3 text-center">
          We pioneered the discount broking model in India.<br></br> Now, we are breaking
          ground with our technology.
        </h1>
      </div>
      <div className="row  mt-5 mb-5 p-5 border-top">
        <div className="col">
            <p>We kick-started operations on the 15th of August, 2010 with the goal of breaking all barriers that traders and investors face in India in terms of cost, support, and technology. We named the company Zerodha, a combination of Zero and "Rodha", the Sanskrit word for barrier.</p>
            <p>Today, our disruptive pricing models and in-house technology have made us the biggest stock broker in India.</p>
            <p>Over 1.6+ crore clients place billions of orders every year through our powerful ecosystem of investment platforms, contributing over 15% of all Indian retail trading volumes.</p>
        </div>
        <div className="col">

        </div>
      </div>
    </div>
  );
}

export default Hero;
